export class Student{
    constructor(studentId,subgroup,firstName,lastName,email,major,uni,fac){
        this.studentId=studentId;
        this.subgroup=subgroup;
        this.firstName=firstName;
        this.lastName=lastName;
        this.email = email;
        this.major = major;
        this.uni = uni;
        this.fac = fac;
    }
}


